import React from 'react';
import logo from './logo.svg';
import './App.css';
import Nav from './Nav';
import About from './About';
import Shop from './Shop';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";


function App() {
  return (
    <Router>
    <div className="App">
    <Nav />
    <Route path = ""/>

    <Shop />
    </div>
    </Router>
  );
}

export default App;
